		"full_text": "고질병인가보네. 개인이메일은 돈주고 다른 곳에서 쓰고 있고 수익이 없는 곳의 도메인 이메일 필요해서 선택했는데 지메일로 메일이 가져오지 않고 누락됨. 다른 지메일 계정에는 들어가는데 본 지메일에는 오질 않는다던가. 서버오류 뿜뿜 하면서 해제하라고 알림뜬다던가. https://t.co/vjMEDAAddY",
