		"text": "안타까운 비보로, 예정되었던 \"이달의 소녀 - 목소리 Art Film' 콘텐츠 오픈 일정을 조정하게 되었습니다. \n\n편성은 하루 연기된 ‘11월 4일 AM 0’에 진행 예정이니 손꼽아 기다리셨을 팬 여러분의 너른 양해 부탁드립니다. 깊은 애도를 표하며, 삼가 고인의 명복을 빕니다."
